values have not been returned for security.'=>'છટકી ગયેલા HTML મૂલ્યો પરત કરવા માત્ર ત્યારે જ શક્ય છે જ્યારે format_value પણ સાચું હોય. સુરક્ષા માટે ફીલ્ડ મૂલ્યો પરત કરવામાં આવ્યા નથી.','Returning an escaped HTML value is only possible when format_value is also true. The field value has not been returned for security.'=>'એસ્કેપ કરેલ HTML મૂલ્ય પરત કરવું ત્યારે જ શક્ય છે જ્યારે format_value પણ સાચું હોય. સુરક્ષા માટે ફીલ્ડ મૂલ્ય પરત કરવામાં આવ્યું નથી.','%1$s ACF now automatically escapes unsafe HTML when rendered by <code>the_field</code> or the ACF shortcode. We\'ve detected the output of some of your fields has been modified by this change, but this may not be a breaking change. %2$s.'=>'%1$s ACF હવે <code>the_field</code> અથવા ACF શોર્ટકોડ દ્વારા રેન્ડર કરતી વખતે અસલામત HTML ને સ્વયંક્રીય રીતે એસ્કેપ કરે છે. અમને કેટલીક ફીલ્ડ્સનું આઉટપુટ આ પરિવર્તનથી બદલાય ગયું હોવાથી શોધાયું છે, પરંતુ આ જરૂરિયાતે તોડી દેવાનું પરિવર્તન નહીં હોઈ શકે. %2$s.','Please contact your site administrator or developer for more details.'=>'વધુ વિગતો માટે કૃપા કરીને તમારા સાઇટ એડમિનિસ્ટ્રેટર અથવા ડેવલપરનો સંપર્ક કરો.','Learn&nbsp;more'=>'વધુ&nbsp;જાણો','Hide&nbsp;details'=>'&nbsp;વિગતો છુપાવો','Show&nbsp;details'=>'&nbsp;વિગતો બતાવો','%1$s (%2$s) - rendered via %3$s'=>'%1$s (%2$s) - %3$s દ્વારા પ્રસ્તુત','Renew ACF PRO License'=>'ACF PRO લાઇસન્સ રિન્યૂ કરો','Renew License'=>'લાયસન્સ રિન્યૂ કરો','Manage License'=>'લાયસન્સ મેનેજ કરો','\'High\' position not supported in the Block Editor'=>'બ્લોક એડિટરમાં \'ઉચ્ચ\' સ્થિતિ સમર્થિત નથી','Upgrade to ACF PRO'=>'ACF PRO પર અપગ્રેડ કરો','ACF <a href="%s" target="_blank">options pages</a> are custom admin pages for managing global settings via fields. You can create multiple pages and sub-pages.'=>'ACF <a href="%s" target="_blank">વિકલ્પો પૃષ્ઠો</a> એ ક્ષેત્રો દ્વારા વૈશ્વિક સેટિંગ્સનું સંચાલન કરવા માટેના કસ્ટમ એડમિન પૃષ્ઠો છે. તમે બહુવિધ પૃષ્ઠો અને પેટા પૃષ્ઠો બનાવી શકો છો.','Add Options Page'=>'વિકલ્પો પૃષ્ઠ ઉમેરો','In the editor used as the placeholder of the title.'=>'શીર્ષકના પ્લેસહોલ્ડર તરીકે ઉપયોગમાં લેવાતા એડિટરમાં.','Title Placeholder'=>'શીર્ષક પ્લેસહોલ્ડર','4 Months Free'=>'4 મહિના મફત','(Duplicated from %s)'=>' (%s માંથી ડુપ્લિકેટ)','Select Options Pages'=>'વિકલ્પો પૃષ્ઠો પસંદ કરો','Duplicate taxonomy'=>'ડુપ્લિકેટ વર્ગીકરણ','Create taxonomy'=>'વર્ગીકરણ બનાવો','Duplicate post type'=>'ડુપ્લિકેટ પોસ્ટ પ્રકાર','Create post type'=>'પોસ્ટ પ્રકાર બનાવો','Link field groups'=>'ફીલ્ડ જૂથોને લિંક કરો','Add fields'=>'ક્ષેત્રો ઉમેરો','This Field'=>'આ ક્ષેત્ર','ACF PRO'=>'એસીએફ પ્રો','Feedback'=>'પ્રતિસાદ','Support'=>'સપોર્ટ','is developed and maintained by'=>'દ્વારા વિકસિત અને જાળવણી કરવામાં આવે છે','Add this %s to the location rules of the selected field groups.'=>'પસંદ કરેલ ક્ષેત્ર જૂથોના સ્થાન નિયમોમાં આ %s ઉમેરો.','Enabling the bidirectional setting allows you to update a value in the target fields for each value selected for this field, adding or removing the Post ID, Taxonomy ID or User ID of the item being updated. For more information, please read the <a href="%s" target="_blank">documentation</a>.'=>'દ્વિપક્ષીય સેટિંગને સક્ષમ કરવાથી તમે આ ફીલ્ડ માટે પસંદ કરેલ દરેક મૂલ્ય માટે લક્ષ્ય ફીલ્ડમાં મૂલ્ય અપડેટ કરી શકો છો, પોસ્ટ ID, વર્ગીકરણ ID અથવા અપડેટ કરવામાં આવી રહેલી આઇટમના વપરાશકર્તા ID ને ઉમેરીને અથવા દૂર કરી શકો છો. વધુ માહિતી માટે, કૃપા કરીને <a href="%s" target="_blank">દસ્તાવેજીકરણ</a> વાંચો.','Select field(s) to store the reference back to the item being updated. You may select this field. Target fields must be compatible with where this field is being displayed. For example, if this field is displayed on a Taxonomy, your target field should be of type Taxonomy'=>'અપડેટ કરવામાં આવી રહેલી આઇટમનો સંદર્ભ પાછો સંગ્રહિત કરવા માટે ક્ષેત્ર(ઓ) પસંદ કરો. તમે આ ક્ષેત્ર પસંદ કરી શકો છો. જ્યાં આ ક્ષેત્ર પ્રદર્શિત થઈ રહ્યું છે તેની સાથે લક્ષ્ય ક્ષેત્રો સુસંગત હોવા જોઈએ. ઉદાહરણ તરીકે, જો આ ક્ષેત્ર વર્ગીકરણ પર પ્રદર્શિત થાય છે, તો તમારું લક્ષ્ય ક્ષેત્ર વર્ગીકરણ પ્રકારનું હોવું જોઈએ','Target Field'=>'લક્ષ્ય ક્ષેત્ર','Update a field on the selected values, referencing back to this ID'=>'આ ID નો સંદર્ભ આપીને પસંદ કરેલ મૂલ્યો પર ફીલ્ડ અપડેટ કરો','Bidirectional'=>'દ્વિપક્ષીય','%s Field'=>'%s ફીલ્ડ','Select Multiple'=>'બહુવિધ પસંદ કરો','WP Engine logo'=>'WP એન્જિન લોગો','Lower case letters, underscores and dashes only, Max 32 characters.'=>'લોઅર કેસ અક્ષરો, માત્ર અન્ડરસ્કોર અને ડૅશ, મહત્તમ 32 અક્ષરો.','The capability name for assigning terms of this taxonomy.'=>'આ વર્ગીકરણની શરતો સોંપવા માટેની ક્ષમતાનું નામ.','Assign Terms Capability'=>'ટર્મ ક્ષમતા સોંપો','The capability name for deleting terms of this taxonomy.'=>'આ વર્ગીકરણની શરતોને કાઢી નાખવા માટેની ક્ષમતાનું નામ.','Delete Terms Capability'=>'ટર્મ ક્ષમતા કાઢી નાખો','The capability name for editing terms of this taxonomy.'=>'આ વર્ગીકરણની શરતોને સંપાદિત કરવા માટેની ક્ષમતાનું નામ.','Edit Terms Capability'=>'શરતો ક્ષમતા સંપાદિત કરો','The capability name for managing terms of this taxonomy.'=>'આ વર્ગીકરણની શરતોનું સંચાલન કરવા માટેની ક્ષમતાનું નામ.','Manage Terms Capability'=>'શરતોની ક્ષમતા મેનેજ કરો','Sets whether posts should be excluded from search results and taxonomy archive pages.'=>'શોધ પરિણામો અને વર્ગીકરણ આર્કાઇવ પૃષ્ઠોમાંથી પોસ્ટ્સને બાકાત રાખવા જોઈએ કે કેમ તે સેટ કરે છે.','More Tools from WP Engine'=>'WP એન્જિનના વધુ સાધનો','Built for those that build with WordPress, by the team at %s'=>'%s પરની ટીમ દ્વારા વર્ડપ્રેસ સાથે બિલ્ડ કરનારાઓ માટે બનાવેલ છે','View Pricing & Upgrade'=>'કિંમત અને અપગ્રેડ જુઓ','Learn More'=>'વધુ શીખો','Speed up your workflow and develop better websites with features like ACF Blocks and Options Pages, and sophisticated field types like Repeater, Flexible Content, Clone, and Gallery.'=>'તમારા વર્કફ્લોને ઝડપી બનાવો અને ACF બ્લોક્સ અને ઓપ્શન્સ પેજીસ જેવી સુવિધાઓ અને રિપીટર, ફ્લેક્સિબલ કન્ટેન્ટ, ક્લોન અને ગેલેરી જેવા અત્યાધુનિક ફીલ્ડ પ્રકારો સાથે વધુ સારી વેબસાઇટ્સ વિકસાવો.','Unlock Advanced Features and Build Even More with ACF PRO'=>'ACF PRO સાથે અદ્યતન સુવિધાઓને અનલૉક કરો અને હજી વધુ બનાવો','%s fields'=>'%s ફીલ્ડ','No terms'=>'કોઈ શરતો નથી','No post types'=>'કોઈ પોસ્ટ પ્રકાર નથી','No posts'=>'કોઈ પોસ્ટ નથી','No taxonomies'=>'કોઈ વર્ગીકરણ નથી','No field groups'=>'કોઈ ક્ષેત્ર જૂથો નથી','No fields'=>'કોઈ ફીલ્ડ નથી','No description'=>'કોઈ વર્ણન નથી','Any post status'=>'કોઈપણ પોસ્ટ સ્થિતિ','This taxonomy key is already in use by another taxonomy registered outside of ACF and cannot be used.'=>'આ વર્ગીકરણ કી પહેલેથી જ ACF ની બહાર નોંધાયેલ અન્ય વર્ગીકરણ દ્વારા ઉપયોગમાં લેવાય છે અને તેનો ઉપયોગ કરી શકાતો નથી.','This taxonomy key is already in use by another taxonomy in ACF and cannot be used.'=>'આ વર્ગીકરણ કી પહેલેથી જ ACF માં અન્ય વર્ગીકરણ દ્વારા ઉપયોગમાં લેવાય છે અને તેનો ઉપયોગ કરી શકાતો નથી.','The taxonomy key must only contain lower case alphanumeric characters, underscores or dashes.'=>'વર્ગીકરણ કી માં માત્ર લોઅર કેસ આલ્ફાન્યૂમેરિક અક્ષરો, અન્ડરસ્કોર અથવા ડેશ હોવા જોઈએ.','The taxonomy key must be under 32 characters.'=>'વર્ગીકરણ કી 32 અક્ષરોથી ઓછી હોવી જોઈએ.','No Taxonomies found in Trash'=>'ટ્રેશમાં કોઈ વર્ગીકરણ મળ્યું નથી','No Taxonomies found'=>'કોઈ વર્ગીકરણ મળ્યું નથી','Search Taxonomies'=>'વર્ગીકરણ શોધો','View Taxonomy'=>'વર્ગીકરણ જુઓ','New Taxonomy'=>'નવુ વર્ગીકરણ','Edit Taxonomy'=>'વર્ગીકરણ સંપાદિત કરો','Add New Taxonomy'=>'નવુ વર્ગીકરણ ઉમેરો','No Post Types found in Trash'=>'ટ્રેશમાં કોઈ પોસ્ટ પ્રકારો મળ્યા નથી','No Post Types found'=>'કોઈ પોસ્ટ પ્રકારો મળ્યા નથી','Search Post Types'=>'પોસ્ટ પ્રકારો શોધો','View Post Type'=>'પોસ્ટનો પ્રકાર જુઓ','New Post Type'=>'નવો પોસ્ટ પ્રકાર','Edit Post Type'=>'પોસ્ટ પ્રકાર સંપાદિત કરો','Add New Post Type'=>'નવો પોસ્ટ પ્રકાર ઉમેરો','This post type key is already in use by another post type registered outside of ACF and cannot be used.'=>'આ પોસ્ટ ટાઇપ કી પહેલેથી જ ACF ની બહાર નોંધાયેલ અન્ય પોસ્ટ પ્રકાર દ્વારા ઉપયોગમાં લેવાય છે અને તેનો ઉપયોગ કરી શકાતો નથી.','This post type key is already in use by another post type in ACF and cannot be used.'=>'આ પોસ્ટ ટાઇપ કી પહેલેથી જ ACF માં અન્ય પોસ્ટ પ્રકાર દ્વારા ઉપયોગમાં છે અને તેનો ઉપયોગ કરી શકાતો નથી.','This field must not be a WordPress <a href="%s" target="_blank">reserved term</a>.'=>'આ ફીલ્ડ વર્ડપ્રેસનો <a href="%s" target="_blank">આરક્ષિત શબ્દ</a> ન હોવો જોઈએ.','The post type key must only contain lower case alphanumeric characters, underscores or dashes.'=>'પોસ્ટ ટાઈપ કીમાં માત્ર લોઅર કેસ આલ્ફાન્યૂમેરિક અક્ષરો, અન્ડરસ્કોર અથવા ડેશ હોવા જોઈએ.','The post type key must be under 20 characters.'=>'પોસ્ટ પ્રકાર કી 20 અક્ષરોથી ઓછી હોવી જોઈએ.','We do not recommend using this field in ACF Blocks.'=>'અમે ACF બ્લોક્સમાં આ ક્ષેત્રનો ઉપયોગ કરવાની ભલામણ કરતા નથી.','Displays the WordPress WYSIWYG editor as seen in Posts and Pages allowing for a rich text-editing experience that also allows for multimedia content.'=>'વર્ડપ્રેસ WYSIWYG એડિટર પ્રદર્શિત કરે છે જે પોસ્ટ્સ અને પૃષ્ઠો જોવા મળે છે જે સમૃદ્ધ ટેક્સ્ટ-એડિટિંગ અનુભવ માટે પરવાનગી આપે છે જે મલ્ટીમીડિયા સામગ્રી માટે પણ પરવાનગી આપે છે.','WYSIWYG Editor'=>'WYSIWYG સંપાદક','Allows the selection of one or more users which can be used to create relationships between data objects.'=>'એક અથવા વધુ વપરાશકર્તાઓની પસંદગીની મંજૂરી આપે છે જેનો ઉપયોગ ડેટા ઑબ્જેક્ટ્સ વચ્ચે સંબંધ બનાવવા માટે થઈ શકે છે.','A text input specifically designed for storing web addresses.'=>'ખાસ કરીને વેબ એડ્રેસ સ્ટોર કરવા માટે રચાયેલ ટેક્સ્ટ ઇનપુટ.','URL'=>'URL','A toggle that allows you to pick a value of 1 or 0 (on or off, true or false, etc). Can be presented as a stylized switch or checkbox.'=>'એક ટૉગલ જે તમને 1 અથવા 0 (ચાલુ અથવા બંધ, સાચું કે ખોટું, વગેરે) નું મૂલ્ય પસંદ કરવાની મંજૂરી આપે છે. સ્ટાઇલાઇઝ્ડ સ્વીચ અથવા ચેકબોક્સ તરીકે રજૂ કરી શકાય છે.','An interactive UI for picking a time. The time format can be customized using the field settings.'=>'સમય પસંદ કરવા માટે એક ઇન્ટરેક્ટિવ UI. ક્ષેત્ર સેટિંગ્સ ઉપયોગ કરીને સમય ફોર્મેટ કસ્ટમાઇઝ કરી શકાય છે.','A basic textarea input for storing paragraphs of text.'=>'ટેક્સ્ટના ફકરાને સ્ટોર કરવા માટે મૂળભૂત ટેક્સ્ટેરિયા ઇનપુટ.','A basic text input, useful for storing single string values.'=>'મૂળભૂત મૂળ લખાણ ઇનપુટ, એક તાર મૂલ્યો સંગ્રહ કરવા માટે ઉપયોગી.','Allows the selection of one or more taxonomy terms based on the criteria and options specified in the fields settings.'=>'ફીલ્ડ સેટિંગ્સમાં ઉલ્લેખિત માપદંડ અને વિકલ્પોના આધારે એક અથવા વધુ વર્ગીકરણ શરતોની પસંદગીની મંજૂરી આપે છે.','Allows you to group fields into tabbed sections in the edit screen. Useful for keeping fields organized and structured.'=>'તમને સંપાદન સ્ક્રીનમાં ટેબ કરેલ વિભાગોમાં ક્ષેત્રોને જૂથબદ્ધ કરવાની મંજૂરી આપે છે. ક્ષેત્રોને વ્યવસ્થિત અને સંરચિત રાખવા માટે ઉપયોગી.','A dropdown list with a selection of choices that you specify.'=>'તમે ઉલ્લેખિત કરો છો તે પસંદગીઓની પસંદગી સાથે ડ્રોપડાઉન સૂચિ.','A dual-column interface to select one or more posts, pages, or custom post type items to create a relationship with the item that you\'re currently editing. Includes options to search and filter.'=>'તમે હાલમાં સંપાદિત કરી રહ્યાં છો તે આઇટમ સાથે સંબંધ બનાવવા માટે એક અથવા વધુ પોસ્ટ્સ, પૃષ્ઠો અથવા કસ્ટમ પોસ્ટ પ્રકારની આઇટમ્સ પસંદ કરવા માટેનું ડ્યુઅલ-કૉલમ ઇન્ટરફેસ. શોધવા અને ફિલ્ટર કરવાના વિકલ્પોનો સમાવેશ થાય છે.','An input for selecting a numerical value within a specified range using a range slider element.'=>'શ્રેણી સ્લાઇડર તત્વનો ઉપયોગ કરીને ઉલ્લેખિત શ્રેણીમાં સંખ્યાત્મક મૂલ્ય પસંદ કરવા માટેનું ઇનપુટ.','A group of radio button inputs that allows the user to make a single selection from values that you specify.'=>'રેડિયો બટન ઇનપુટ્સનું એક જૂથ જે વપરાશકર્તાને તમે ઉલ્લેખિત મૂલ્યોમાંથી એક જ પસંદગી કરવાની મંજૂરી આપે છે.','An interactive and customizable UI for picking one or many posts, pages or post type items with the option to search. '=>'શોધવાના વિકલ્પ સાથે એક અથવા ઘણી પોસ્ટ્સ, પૃષ્ઠો અથવા પોસ્ટ પ્રકારની વસ્તુઓ પસંદ કરવા માટે એક ઇન્ટરેક્ટિવ અને વૈવિધ્યપૂર્ણ UI. ','An input for providing a password using a masked field.'=>'માસ્ક્ડ ફીલ્ડનો ઉપયોગ કરીને પાસવર્ડ આપવા માટેનું ઇનપુટ.','Filter by Post Status'=>'પોસ્ટ સ્ટેટસ દ્વારા ફિલ્ટર કરો','An interactive dropdown to select one or more posts, pages, custom post type items or archive URLs, with the option to search.'=>'શોધવાના વિકલ્પ સાથે, એક અથવા વધુ પોસ્ટ્સ, પૃષ્ઠો, કસ્ટમ પોસ્ટ પ્રકારની આઇટમ્સ અથવા આર્કાઇવ URL પસંદ કરવા માટે એક ઇન્ટરેક્ટિવ ડ્રોપડાઉન.','An interactive component for embedding videos, images, tweets, audio and other content by making use of the native WordPress oEmbed functionality.'=>'મૂળ WordPress oEmbed કાર્યક્ષમતાનો ઉપયોગ કરીને વિડિઓઝ, છબીઓ, ટ્વીટ્સ, ઑડિઓ અને અન્ય સામગ્રીને એમ્બેડ કરવા માટે એક ઇન્ટરેક્ટિવ ઘટક.','An input limited to numerical values.'=>'સંખ્યાત્મક મૂલ્યો સુધી મર્યાદિત ઇનપુટ.','Used to display a message to editors alongside other fields. Useful for providing additional context or instructions around your fields.'=>'અન્ય ક્ષેત્રોની સાથે સંપાદકોને સંદેશ પ્રદર્શિત કરવા માટે વપરાય છે. તમારા ક્ષેત્રોની આસપાસ વધારાના સંદર્ભ અથવા સૂચનાઓ પ્રદાન કરવા માટે ઉપયોગી.','Allows you to specify a link and its properties such as title and target using the WordPress native link picker.'=>'તમને વર્ડપ્રેસ મૂળ લિંક પીકરનો ઉપયોગ કરીને લિંક અને તેના ગુણધર્મો જેવા કે શીર્ષક અને લક્ષ્યનો ઉલ્લેખ કરવાની મંજૂરી આપે છે.','Uses the native WordPress media picker to upload, or choose images.'=>'અપલોડ કરવા અથવા છબીઓ પસંદ કરવા માટે મૂળ વર્ડપ્રેસ મીડિયા પીકરનો ઉપયોગ કરે છે.','Provides a way to structure fields into groups to better organize the data and the edit screen.'=>'ડેટા અને સંપાદન સ્ક્રીનને વધુ સારી રીતે ગોઠવવા માટે જૂથોમાં ક્ષેત્રોને સંરચિત કરવાનો માર્ગ પૂરો પાડે છે.','An interactive UI for selecting a location using Google Maps. Requires a Google Maps API key and additional configuration to display correctly.'=>'Google નકશાનો ઉપયોગ કરીને સ્થાન પસંદ કરવા માટે એક ઇન્ટરેક્ટિવ UI. યોગ્ય રીતે પ્રદર્શિત કરવા માટે Google Maps API કી અને વધારાના ગોઠવણીની જરૂર છે.','Uses the native WordPress media picker to upload, or choose files.'=>'અપલોડ કરવા અથવા છબીઓ પસંદ કરવા માટે મૂળ વર્ડપ્રેસ મીડિયા પીકરનો ઉપયોગ કરે છે.','A text input specifically designed for storing email addresses.'=>'ખાસ કરીને ઈમેલ એડ્રેસ સ્ટોર કરવા માટે રચાયેલ ટેક્સ્ટ ઇનપુટ.','An interactive UI for picking a date and time. The date return format can be customized using the field settings.'=>'તારીખ અને સમય પસંદ કરવા માટે એક ઇન્ટરેક્ટિવ UI. તારીખ રીટર્ન ફોર્મેટ ફીલ્ડ સેટિંગ્સનો ઉપયોગ કરીને કસ્ટમાઇઝ કરી શકાય છે.','An interactive UI for picking a date. The date return format can be customized using the field settings.'=>'સમય પસંદ કરવા માટે એક ઇન્ટરેક્ટિવ UI. ક્ષેત્ર સેટિંગ્સ ઉપયોગ કરીને સમય ફોર્મેટ કસ્ટમાઇઝ કરી શકાય છે.','An interactive UI for selecting a color, or specifying a Hex value.'=>'રંગ પસંદ કરવા અથવા હેક્સ મૂલ્યનો ઉલ્લેખ કરવા માટે એક ઇન્ટરેક્ટિવ UI.','A group of checkbox inputs that allow the user to select one, or multiple values that you specify.'=>'ચેકબૉક્સ ઇનપુટ્સનું જૂથ કે જે વપરાશકર્તાને તમે ઉલ્લેખિત કરો છો તે એક અથવા બહુવિધ મૂલ્યો પસંદ કરવાની મંજૂરી આપે છે.','A group of buttons with values that you specify, users can choose one option from the values provided.'=>'તમે ઉલ્લેખિત કરેલ મૂલ્યો સાથેના બટનોનું જૂથ, વપરાશકર્તાઓ પ્રદાન કરેલ મૂલ્યોમાંથી એક વિકલ્પ પસંદ કરી શકે છે.','Allows you to group and organize custom fields into collapsable panels that are shown while editing content. Useful for keeping large datasets tidy.'=>'તમને કન્ટેન્ટ સંપાદિત કરતી વખતે બતાવવામાં આવતી સંકુચિત પેનલ્સમાં કસ્ટમ ફીલ્ડ્સને જૂથ અને ગોઠવવાની મંજૂરી આપે છે. મોટા ડેટાસેટ્સને વ્યવસ્થિત રાખવા માટે ઉપયોગી.','This provides a solution for repeating content such as slides, team members, and call-to-action tiles, by acting as a parent to a set of subfields which can be repeated again and again.'=>'આ સ્લાઇડ્સ, ટીમના સભ્યો અને કૉલ-ટુ-એક્શન ટાઇલ્સ જેવી સામગ્રીને પુનરાવર્તિત કરવા માટેનો ઉકેલ પૂરો પાડે છે, પેરન્ટ તરીકે કામ કરીને પેટાફિલ્ડના સમૂહ કે જેને વારંવાર પુનરાવર્તિત કરી શકાય છે.','This provides an interactive interface for managing a collection of attachments. Most settings are similar to the Image field type. Additional settings allow you to specify where new attachments are added in the gallery and the minimum/maximum number of attachments allowed.'=>'આ જોડાણોના સંગ્રહનું સંચાલન કરવા માટે એક ઇન્ટરેક્ટિવ ઇન્ટરફેસ પૂરું પાડે છે. મોટાભાગની સેટિંગ્સ ઇમેજ ફીલ્ડના પ્રકાર જેવી જ હોય ​​છે. વધારાની સેટિંગ્સ તમને ગેલેરીમાં નવા જોડાણો ક્યાં ઉમેરવામાં આવે છે અને જોડાણોની ન્યૂનતમ/મહત્તમ સંખ્યાને મંજૂરી આપે છે તેનો ઉલ્લેખ કરવાની મંજૂરી આપે છે.','This provides a simple, structured, layout-based editor. The Flexible Content field allows you to define, create and manage content with total control by using layouts and subfields to design the available blocks.'=>'આ એક સરળ, સંરચિત, લેઆઉટ-આધારિત સંપાદક પ્રદાન કરે છે. લવચીક સામગ્રી ક્ષેત્ર તમને ઉપલબ્ધ બ્લોક્સ ડિઝાઇન કરવા માટે લેઆઉટ અને સબફિલ્ડનો ઉપયોગ કરીને સંપૂર્ણ નિયંત્રણ સાથે સામગ્રીને વ્યાખ્યાયિત કરવા, બનાવવા અને સંચાલિત કરવાની મંજૂરી આપે છે.','This allows you to select and display existing fields. It does not duplicate any fields in the database, but loads and displays the selected fields at run-time. The Clone field can either replace itself with the selected fields or display the selected fields as a group of subfields.'=>'આ તમને વર્તમાન ક્ષેત્રોને પસંદ કરવા અને પ્રદર્શિત કરવાની મંજૂરી આપે છે. તે ડેટાબેઝમાં કોઈપણ ફીલ્ડની નકલ કરતું નથી, પરંતુ રન-ટાઇમ પર પસંદ કરેલ ફીલ્ડ્સને લોડ કરે છે અને પ્રદર્શિત કરે છે. ક્લોન ફીલ્ડ કાં તો પોતાને પસંદ કરેલ ફીલ્ડ્સ સાથે બદલી શકે છે અથવા પસંદ કરેલ ફીલ્ડ્સને સબફિલ્ડના જૂથ તરીકે પ્રદર્શિત કરી શકે છે.','nounClone'=>'ક્લોન','PRO'=>'પ્રો','Advanced'=>'અદ્યતન','JSON (newer)'=>'JSON (નવું)','Original'=>'અસલ','Invalid post ID.'=>'અમાન્ય પોસ્ટ આઈડી.','Invalid post type selected for review.'=>'સમીક્ષા માટે અમાન્ય પોસ્ટ પ્રકાર પસંદ કર્યો.','More'=>'વધુ','Tutorial'=>'ટ્યુટોરીયલ','Select Field'=>'ક્ષેત્ર પસંદ કરો','Try a different search term or browse %s'=>'એક અલગ શોધ શબ્દ અજમાવો અથવા %s બ્રાઉઝ કરો','Popular fields'=>'લોકપ્રિય ક્ષેત્રો','No search results for \'%s\''=>'\'%s\' માટે કોઈ શોધ પરિણામો નથી','Search fields...'=>'ફીલ્ડ્સ શોધો...','Select Field Type'=>'ક્ષેત્ર પ્રકાર પસંદ કરો','Popular'=>'પ્રખ્યાત','Add Taxonomy'=>'વર્ગીકરણ ઉમેરો','Create custom taxonomies to classify post type content'=>'પોસ્ટ પ્રકારની સામગ્રીને વર્ગીકૃત કરવા માટે કસ્ટમ વર્ગીકરણ બનાવો','Add Your First Taxonomy'=>'તમારી પ્રથમ વર્ગીકરણ ઉમેરો','Hierarchical taxonomies can have descendants (like categories).'=>'અધિક્રમિક વર્ગીકરણમાં વંશજો હોઈ શકે છે (જેમ કે શ્રેણીઓ).','Makes a taxonomy visible on the frontend and in the admin dashboard.'=>'અગ્રભાગ પર અને એડમિન ડેશબોર્ડમાં વર્ગીકરણ દૃશ્યમાન બનાવે છે.','One or many post types that can be classified with this taxonomy.'=>'આ વર્ગીકરણ સાથે વર્ગીકૃત કરી શકાય તેવા એક અથવા ઘણા પોસ્ટ પ્રકારો.','genre'=>'શૈલી','Genre'=>'શૈલી','Genres'=>'શૈલીઓ','Optional custom controller to use instead of `WP_REST_Terms_Controller `.'=>'`WP_REST_Terms_Controller` ને બદલે વાપરવા માટે વૈકલ્પિક કસ્ટમ નિયંત્રક.','Expose this post type in the REST API.'=>'REST API માં આ પોસ્ટ પ્રકારનો પર્દાફાશ કરો.','Customize the query variable name'=>'ક્વેરી વેરીએબલ નામને કસ્ટમાઇઝ કરો','Terms can be accessed using the non-pretty permalink, e.g., {query_var}={term_slug}.'=>'બિન-સુંદર પરમાલિંકનો ઉપયોગ કરીને શરતોને ઍક્સેસ કરી શકાય છે, દા.ત., {query_var}={term_slug}.','Parent-child terms in URLs for hierarchical taxonomies.'=>'વંશવેલો વર્ગીકરણ માટે URL માં માતાપિતા-બાળક શબ્દો.','Customize the slug used in the URL'=>'URL માં વપરાયેલ સ્લગને કસ્ટમાઇઝ કરો','Permalinks for this taxonomy are disabled.'=>'આ વર્ગીકરણ માટે પરમાલિંક્સ અક્ષમ છે.','Rewrite the URL using the taxonomy key as the slug. Your permalink structure will be'=>'સ્લગ તરીકે વર્ગીકરણ કીનો ઉપયોગ કરીને URL ને ફરીથી લખો. તમારું પરમાલિંક માળખું હશે','Taxonomy Key'=>'વર્ગીકરણ કી','Select the type of permalink to use for this taxonomy.'=>'આ વર્ગીકરણ માટે વાપરવા માટે પરમાલિંકનો પ્રકાર પસંદ કરો.','Display a column for the taxonomy on post type listing screens.'=>'પોસ્ટ ટાઇપ લિસ્ટિંગ સ્ક્રીન પર વર્ગીકરણ માટે કૉલમ પ્રદર્શિત કરો.','Show Admin Column'=>'એડમિન કૉલમ બતાવો','Show the taxonomy in the quick/bulk edit panel.'=>'ઝડપી/બલ્ક સંપાદન પેનલમાં વર્ગીકરણ બતાવો.','Quick Edit'=>'ઝડપી સંપાદન','List the taxonomy in the Tag Cloud Widget controls.'=>'ટેગ ક્લાઉડ વિજેટ નિયંત્રણોમાં વર્ગીકરણની સૂચિ બનાવો.','Tag Cloud'=>'ટૅગ ક્લાઉડ','A PHP function name to be called for sanitizing taxonomy data saved from a meta box.'=>'મેટા બૉક્સમાંથી સાચવેલા વર્ગીકરણ ડેટાને સેનિટાઇઝ કરવા માટે કૉલ કરવા માટે PHP ફંક્શન નામ.','Meta Box Sanitization Callback'=>'મેટા બોક્સ સેનિટાઈઝેશન કોલબેક','Register Meta Box Callback'=>'મેટા બોક્સ કોલબેક રજીસ્ટર કરો','No Meta Box'=>'કોઈ મેટા બોક્સ નથી','Custom Meta Box'=>'કસ્ટમ મેટા બોક્સ','Controls the meta box on the content editor screen. By default, the Categories meta box is shown for hierarchical taxonomies, and the Tags meta box is shown for non-hierarchical taxonomies.'=>'સામગ્રી સંપાદક સ્ક્રીન પરના મેટા બોક્સને નિયંત્રિત કરે છે. મૂળભૂત રીતે, શ્રેણીઓ મેટા બોક્સ અધિક્રમિક વર્ગીકરણ માટે બતાવવામાં આવે છે, અને ટૅગ્સ મેટા બૉક્સ બિન-હાયરાર્કિકલ વર્ગીકરણ માટે બતાવવામાં આવે છે.','Meta Box'=>'મેટા બોક્સ','Categories Meta Box'=>'શ્રેણીઓ મેટા બોક્સ','Tags Meta Box'=>'ટૅગ્સ મેટા બોક્સ','A link to a tag'=>'ટેગની લિંક','Describes a navigation link block variation used in the block editor.'=>'બ્લોક એડિટરમાં વપરાતી નેવિગેશન લિંક બ્લોક ભિન્નતાનું વર્ણન કરે છે.','A link to a %s'=>'%s ની લિંક','Tag Link'=>'ટૅગ લિંક','Assigns a title for navigation link block variation used in the block editor.'=>'બ્લોક એડિટરમાં વપરાતી નેવિગેશન લિંક બ્લોક ભિન્નતાનું વર્ણન કરે છે.','← Go to tags'=>'← ટૅગ્સ પર જાઓ','Assigns the text used to link back to the main index after updating a term.'=>'શબ્દને અપડેટ કર્યા પછી મુખ્ય અનુક્રમણિકા સાથે પાછા લિંક કરવા માટે વપરાયેલ ટેક્સ્ટને સોંપે છે.','Back To Items'=>'આઇટમ્સ પર પાછા ફરો','← Go to %s'=>'← %s પર જાઓ','Tags list'=>'ટૅગ્સની સૂચિ','Assigns text to the table hidden heading.'=>'કોષ્ટક છુપાયેલા મથાળાને ટેક્સ્ટ અસાઇન કરે છે.','Tags list navigation'=>'ટૅગ્સ સૂચિ નેવિગેશન','Assigns text to the table pagination hidden heading.'=>'કોષ્ટક પૃષ્ઠ ક્રમાંકન છુપાયેલા મથાળાને ટેક્સ્ટ અસાઇન કરે છે.','Filter by category'=>'શ્રેણી દ્વારા ફિલ્ટર કરો','Assigns text to the filter button in the posts lists table.'=>'પોસ્ટ લિસ્ટ ટેબલમાં ફિલ્ટર બટન પર ટેક્સ્ટ અસાઇન કરે છે.','Filter By Item'=>'આઇટમ દ્વારા ફિલ્ટર કરો','Filter by %s'=>'%s દ્વારા ફિલ્ટર કરો','The description is not prominent by default; however, some themes may show it.'=>'આ વર્ણન મૂળભૂત રીતે જાણીતું નથી; તેમ છતાં, કોઈક થિમમા કદાચ દેખાય.','Describes the Description field on the Edit Tags screen.'=>'એડિટ ટૅગ્સ સ્ક્રીન પર પેરેન્ટ ફીલ્ડનું વર્ણન કરે છે.','Description Field Description'=>'વર્ણન ક્ષેત્રનું વર્ણન','Assign a parent term to create a hierarchy. The term Jazz, for example, would be the parent of Bebop and Big Band'=>'અધિક્રમ(hierarchy) બનાવવા માટે એક પેરન્ટ ટર્મ સોંપો. ઉદાહરણ તરીકે જાઝ ટર્મ, બેબોપ અને બિગ બેન્ડની પેરન્ટ હશે.','Describes the Parent field on the Edit Tags screen.'=>'એડિટ ટૅગ્સ સ્ક્રીન પર પેરેન્ટ ફીલ્ડનું વર્ણન કરે છે.','Parent Field Description'=>'પિતૃ ક્ષેત્રનું વર્ણન','The "slug" is the URL-friendly version of the name. It is usually all lower case and contains only letters, numbers, and hyphens.'=>'"સ્લગ" એ નામનું URL-મૈત્રીપૂર્ણ સંસ્કરણ છે. તે સામાન્ય રીતે બધા લોઅરકેસ હોય છે અને તેમાં માત્ર અક્ષરો, સંખ્યાઓ અને હાઇફન્સ હોય છે.','Describes the Slug field on the Edit Tags screen.'=>'એડિટ ટૅગ્સ સ્ક્રીન પર નામ ફીલ્ડનું વર્ણન કરે છે.','Slug Field Description'=>'નામ ક્ષેત્ર વર્ણન','The name is how it appears on your site'=>'નામ જે તમારી સાઇટ પર દેખાશે.','Describes the Name field on the Edit Tags screen.'=>'એડિટ ટૅગ્સ સ્ક્રીન પર નામ ફીલ્ડનું વર્ણન કરે છે.','Name Field Description'=>'નામ ક્ષેત્ર વર્ણન','No tags'=>'ટૅગ્સ નથી','Assigns the text displayed in the posts and media list tables when no tags or categories are available.'=>'જ્યારે કોઈ ટૅગ્સ અથવા કૅટેગરીઝ ઉપલબ્ધ ન હોય ત્યારે પોસ્ટ્સ અને મીડિયા સૂચિ કોષ્ટકોમાં પ્રદર્શિત ટેક્સ્ટને અસાઇન કરે છે.','No Terms'=>'કોઈ શરતો નથી','No %s'=>'ના %s','No tags found'=>'કોઈ ટેગ મળ્યા નથી','Assigns the text displayed when clicking the \'choose from most used\' text in the taxonomy meta box when no tags are available, and assigns the text used in the terms list table when there are no items for a taxonomy.'=>'જ્યારે કોઈ ટૅગ્સ ઉપલબ્ધ ન હોય ત્યારે વર્ગીકરણ મેટા બૉક્સમાં \'સૌથી વધુ વપરાયેલામાંથી પસંદ કરો\' ટેક્સ્ટને ક્લિક કરતી વખતે પ્રદર્શિત ટેક્સ્ટને અસાઇન કરે છે અને જ્યારે વર્ગીકરણ માટે કોઈ આઇટમ ન હોય ત્યારે ટર્મ્સ લિસ્ટ કોષ્ટકમાં વપરાયેલ ટેક્સ્ટને અસાઇન કરે છે.','Not Found'=>'મળ્યું નથી','Assigns text to the Title field of the Most Used tab.'=>'સૌથી વધુ ઉપયોગમાં લેવાતી ટેબના શીર્ષક ક્ષેત્રમાં ટેક્સ્ટ અસાઇન કરે છે.','Most Used'=>'સૌથી વધુ વપરાયેલ','Choose from the most used tags'=>'સૌથી વધુ ઉપયોગ થયેલ ટૅગ્સ માંથી પસંદ કરો','Assigns the \'choose from most used\' text used in the meta box when JavaScript is disabled. Only used on non-hierarchical taxonomies.'=>'જ્યારે JavaScript અક્ષમ હોય ત્યારે મેટા બૉક્સમાં વપરાયેલ \'સૌથી વધુ ઉપયોગમાંથી પસંદ કરો\' ટેક્સ્ટને અસાઇન કરે છે. માત્ર બિન-હાયરાર્કીકલ વર્ગીકરણ પર વપરાય છે.','Choose From Most Used'=>'સૌથી વધુ વપરાયેલમાંથી પસંદ કરો','Choose from the most used %s'=>'%s સૌથી વધુ ઉપયોગ થયેલ ટૅગ્સ માંથી પસંદ કરો','Add or remove tags'=>'ટૅગ્સ ઉમેરો અથવા દૂર કરો','Assigns the add or remove items text used in the meta box when JavaScript is disabled. Only used on non-hierarchical taxonomies'=>'જ્યારે JavaScript અક્ષમ હોય ત્યારે મેટા બૉક્સમાં ઉપયોગમાં લેવાતી આઇટમ્સ ઉમેરો અથવા દૂર કરો ટેક્સ્ટને સોંપે છે. માત્ર બિન-હાયરાર્કીકલ વર્ગીકરણ પર વપરાય છે','Add Or Remove Items'=>'વસ્તુઓ ઉમેરો અથવા દૂર કરો','Add or remove %s'=>'%s ઉમેરો અથવા દૂર કરો','Separate tags with commas'=>'અલ્પવિરામથી ટૅગ્સ અલગ કરો','Assigns the separate item with commas text used in the taxonomy meta box. Only used on non-hierarchical taxonomies.'=>'વર્ગીકરણ મેટા બોક્સમાં વપરાયેલ અલ્પવિરામ ટેક્સ્ટ સાથે અલગ આઇટમ સોંપે છે. માત્ર બિન-હાયરાર્કીકલ વર્ગીકરણ પર વપરાય છે.','Separate Items With Commas'=>'અલ્પવિરામથી ટૅગ્સ અલગ કરો','Separate %s with commas'=>'અલ્પવિરામથી %s ને અલગ કરો','Popular Tags'=>'લોકપ્રિય ટૅગ્સ','Assigns popular items text. Only used for non-hierarchical taxonomies.'=>'લોકપ્રિય આઇટમ ટેક્સ્ટ અસાઇન કરે છે. માત્ર બિન-હાયરાર્કીકલ વર્ગીકરણ માટે વપરાય છે.','Popular Items'=>'લોકપ્રિય વસ્તુઓ','Popular %s'=>'લોકપ્રિય %s','Search Tags'=>'ટૅગ્સ શોધો','Assigns search items text.'=>'શોધ આઇટમ ટેક્સ્ટ સોંપે છે.','Parent Category:'=>'પિતૃ શ્રેણી:','Assigns parent item text, but with a colon (:) added to the end.'=>'પેરેન્ટ આઇટમ ટેક્સ્ટ અસાઇન કરે છે, પરંતુ અંતમાં કોલોન (:) સાથે ઉમેરવામાં આવે છે.','Parent Item With Colon'=>'કોલોન સાથે પિતૃ શ્રેણી','Parent Category'=>'પિતૃ શ્રેણી','Assigns parent item text. Only used on hierarchical taxonomies.'=>'પેરેન્ટ આઇટમ ટેક્સ્ટ અસાઇન કરે છે. માત્ર અધિક્રમિક વર્ગીકરણ પર વપરાય છે.','Parent Item'=>'પિતૃ વસ્તુ','Parent %s'=>'પેરન્ટ %s','New Tag Name'=>'નવા ટેગ નું નામ','Assigns the new item name text.'=>'નવી આઇટમ નામનો ટેક્સ્ટ અસાઇન કરે છે.','New Item Name'=>'નવી આઇટમનું નામ','New %s Name'=>'નવું %s નામ','Add New Tag'=>'નવું ટેગ ઉમેરો','Assigns the add new item text.'=>'નવી આઇટમ ઉમેરો ટેક્સ્ટ સોંપે છે.','Update Tag'=>'અદ્યતન ટેગ','Assigns the update item text.'=>'અપડેટ આઇટમ ટેક્સ્ટ સોંપે છે.','Update Item'=>'આઇટમ અપડેટ કરો','Update %s'=>'%s અપડેટ કરો','View Tag'=>'ટેગ જુઓ','In the admin bar to view term during editing.'=>'સંપાદન દરમિયાન શબ્દ જોવા માટે એડમિન બારમાં.','Edit Tag'=>'ટેગ માં ફેરફાર કરો','At the top of the editor screen when editing a term.'=>'શબ્દ સંપાદિત કરતી વખતે સંપાદક સ્ક્રીનની ટોચ પર.','All Tags'=>'બધા ટૅગ્સ','Assigns the all items text.'=>'બધી આઇટમ ટેક્સ્ટ અસાઇન કરે છે.','Assigns the menu name text.'=>'મેનુ નામ લખાણ સોંપે છે.','Menu Label'=>'મેનુ લેબલ','Active taxonomies are enabled and registered with WordPress.'=>'સક્રિય વર્ગીકરણ વર્ડપ્રેસ સાથે સક્ષમ અને નોંધાયેલ છે.','A descriptive summary of the taxonomy.'=>'વર્ગીકરણનો વર્ણનાત્મક સારાંશ.','A descriptive summary of the term.'=>'શબ્દનો વર્ણનાત્મક સારાંશ.','Term Description'=>'ટર્મ વર્ણન','Single word, no spaces. Underscores and dashes allowed.'=>'એક શબ્દ, કોઈ જગ્યા નથી. અન્ડરસ્કોર અને ડેશની મંજૂરી છે.','Term Slug'=>'ટર્મ સ્લગ','The name of the default term.'=>'મૂળભૂત શબ્દનું નામ.','Term Name'=>'ટર્મ નામ','Create a term for the taxonomy that cannot be deleted. It will not be selected for posts by default.'=>'વર્ગીકરણ માટે એક શબ્દ બનાવો કે જેને કાઢી ન શકાય. તે મૂળભૂત રીતે પોસ્ટ્સ માટે પસંદ કરવામાં આવશે નહીં.','Default Term'=>'ડિફૉલ્ટ ટર્મ','Whether terms in this taxonomy should be sorted in the order they are provided to `wp_set_object_terms()`.'=>'શું આ વર્ગીકરણની શરતો `wp_set_object_terms()` ને પ્રદાન કરવામાં આવી છે તે ક્રમમાં સૉર્ટ કરવી જોઈએ.','Sort Terms'=>'સૉર્ટ શરતો','Add Post Type'=>'નવો પોસ્ટ પ્રકાર','Expand the functionality of WordPress beyond standard posts and pages with custom post types.'=>'વર્ડપ્રેસની કાર્યક્ષમતાને કસ્ટમ પોસ્ટ પ્રકારો સાથે પ્રમાણભૂત પોસ્ટ્સ અને પૃષ્ઠોથી આગળ વિસ્તૃત કરો','Add Your First Post Type'=>'તમારો પ્રથમ પોસ્ટ પ્રકાર ઉમેરો','I know what I\'m doing, show me all the options.'=>'હું જાણું છું કે હું શું કરી રહ્યો છું, મને બધા વિકલ્પો બતાવો.','Advanced Configuration'=>'અદ્યતન રૂપરેખાંકન','Hierarchical post types can have descendants (like pages).'=>'અધિક્રમિક વર્ગીકરણમાં વંશજો હોઈ શકે છે (જેમ કે શ્રેણીઓ).','Hierarchical'=>'વંશવેલો','Visible on the frontend and in the admin dashboard.'=>'અગ્રભાગ પર અને એડમિન ડેશબોર્ડમાં દૃશ્યમાન.','Public'=>'પબ્લિક','movie'=>'ફિલ્મ','Lower case letters, underscores and dashes only, Max 20 characters.'=>'લોઅર કેસ અક્ષરો, માત્ર અન્ડરસ્કોર અને ડૅશ, મહત્તમ ૨૦ અક્ષરો.','Movie'=>'ફિલ્મ','Singular Label'=>'એકવચન નામ','Movies'=>'મૂવીઝ','Plural Label'=>'બહુવચન નામ','Optional custom controller to use instead of `WP_REST_Posts_Controller`.'=>'`WP_REST_Posts_Controller` ને બદલે વાપરવા માટે વૈકલ્પિક કસ્ટમ નિયંત્રક.','Controller Class'=>'નિયંત્રક વર્ગ','The namespace part of the REST API URL.'=>'REST API URL નો નેમસ્પેસ ભાગ.','Namespace Route'=>'નેમસ્પેસ રૂટ','The base URL for the post type REST API URLs.'=>'પોસ્ટ પ્રકાર REST API URL માટે આધાર URL.','Base URL'=>'આધાર URL','Exposes this post type in the REST API. Required to use the block editor.'=>'REST API માં આ પોસ્ટ પ્રકારનો પર્દાફાશ કરે છે. બ્લોક એડિટરનો ઉપયોગ કરવા માટે જરૂરી છે.','Show In REST API'=>'REST API માં બતાવો','Customize the query variable name.'=>'ક્વેરી વેરીએબલ નામને કસ્ટમાઇઝ કરો','Query Variable'=>'ક્વેરી વેરીએબલ','No Query Variable Support'=>'કોઈ ક્વેરી વેરીએબલ સપોર્ટ નથી','Custom Query Variable'=>'કસ્ટમ ક્વેરી વેરીએબલ','Items can be accessed using the non-pretty permalink, eg. {post_type}={post_slug}.'=>'બિન-સુંદર પરમાલિંકનો ઉપયોગ કરીને શરતોને ઍક્સેસ કરી શકાય છે, દા.ત., {query_var}={term_slug}.','Query Variable Support'=>'વેરીએબલ સપોર્ટ ક્વેરી','URLs for an item and items can be accessed with a query string.'=>'આઇટમ અને આઇટમ્સ માટેના URL ને ક્વેરી સ્ટ્રિંગ વડે એક્સેસ કરી શકાય છે.','Publicly Queryable'=>'સાર્વજનિક રૂપે પૂછવા યોગ્ય','Custom slug for the Archive URL.'=>'આર્કાઇવ URL માટે કસ્ટમ સ્લગ.','Archive Slug'=>'આર્કાઇવ સ્લેગ','Has an item archive that can be customized with an archive template file in your theme.'=>'તમારી થીમમાં આર્કાઇવ ટેમ્પલેટ ફાઇલ સાથે કસ્ટમાઇઝ કરી શકાય તેવી આઇટમ આર્કાઇવ ધરાવે છે.','Archive'=>'આર્કાઇવ્સ','Pagination support for the items URLs such as the archives.'=>'આર્કાઇવ્સ જેવી વસ્તુઓ URL માટે પૃષ્ઠ ક્રમાંકન સપોર્ટ.','Pagination'=>'પૃષ્ઠ ક્રમાંકન','RSS feed URL for the post type items.'=>'પોસ્ટ પ્રકારની વસ્તુઓ માટે RSS ફીડ URL.','Feed URL'=>'ફીડ URL','Alters the permalink structure to add the `WP_Rewrite::$front` prefix to URLs.'=>'URL માં `WP_Rwrite::$front` ઉપસર્ગ ઉમેરવા માટે પરમાલિંક માળખું બદલે છે.','Front URL Prefix'=>'ફ્રન્ટ URL ઉપસર્ગ','Customize the slug used in the URL.'=>'URL માં વપરાયેલ સ્લગને કસ્ટમાઇઝ કરો.','URL Slug'=>'URL સ્લગ','Permalinks for this post type are disabled.'=>'આ વર્ગીકરણ માટે પરમાલિંક્સ અક્ષમ છે.','Rewrite the URL using a custom slug defined in the input below. Your permalink structure will be'=>'નીચેના ઇનપુટમાં વ્યાખ્યાયિત કસ્ટમ સ્લગનો ઉપયોગ કરીને URL ને ફરીથી લખો. તમારું પરમાલિંક માળખું હશે','No Permalink (prevent URL rewriting)'=>'કોઈ પરમાલિંક નથી (URL પુનઃલેખન અટકાવો)','Custom Permalink'=>'કસ્ટમ પરમાલિંક','Post Type Key'=>'પોસ્ટ પ્રકાર કી','Rewrite the URL using the post type key as the slug. Your permalink structure will be'=>'સ્લગ તરીકે વર્ગીકરણ કીનો ઉપયોગ કરીને URL ને ફરીથી લખો. તમારું પરમાલિંક માળખું હશે','Permalink Rewrite'=>'પરમાલિંક ફરીથી લખો','Delete items by a user when that user is deleted.'=>'જ્યારે તે વપરાશકર્તા કાઢી નાખવામાં આવે ત્યારે વપરાશકર્તા દ્વારા આઇટમ્સ કાઢી નાખો.','Delete With User'=>'વપરાશકર્તા સાથે કાઢી નાખો','Allow the post type to be exported from \'Tools\' > \'Export\'.'=>'પોસ્ટ પ્રકારને \'ટૂલ્સ\' > \'નિકાસ\'માંથી નિકાસ કરવાની મંજૂરી આપો.','Can Export'=>'નિકાસ કરી શકે છે','Optionally provide a plural to be used in capabilities.'=>'વૈકલ્પિક રીતે ક્ષમતાઓમાં ઉપયોગમાં લેવા માટે બહુવચન પ્રદાન કરો.','Plural Capability Name'=>'બહુવચન ક્ષમતા નામ','Choose another post type to base the capabilities for this post type.'=>'આ પોસ્ટ પ્રકાર માટેની ક્ષમતાઓને આધાર આપવા માટે અન્ય પોસ્ટ પ્રકાર પસંદ કરો.','Singular Capability Name'=>'એકવચન ક્ષમતા નામ','By default the capabilities of the post type will inherit the \'Post\' capability names, eg. edit_post, delete_posts. Enable to use post type specific capabilities, eg. edit_{singular}, delete_{plural}.'=>'મૂળભૂત રીતે પોસ્ટ પ્રકારની ક્ષમતાઓ \'પોસ્ટ\' ક્ષમતાના નામોને વારસામાં મેળવશે, દા.ત. એડિટ_પોસ્ટ, ડિલીટ_પોસ્ટ. પોસ્ટ પ્રકારની વિશિષ્ટ ક્ષમતાઓનો ઉપયોગ કરવા સક્ષમ કરો, દા.ત. edit_{singular}, delete_{plural}.','Rename Capabilities'=>'ક્ષમતાઓનું નામ બદલો','Exclude From Search'=>'શોધમાંથી બાકાત રાખો','Allow items to be added to menus in the \'Appearance\' > \'Menus\' screen. Must be turned on in \'Screen options\'.'=>'આઇટમ્સને \'દેખાવ\' > \'મેનૂઝ\' સ્ક્રીનમાં મેનૂમાં ઉમેરવાની મંજૂરી આપો. \'સ્ક્રીન વિકલ્પો\'માં ચાલુ કરવું આવશ્યક છે.','Appearance Menus Support'=>'દેખાવ મેનુ આધાર','Appears as an item in the \'New\' menu in the admin bar.'=>'એડમિન બારમાં \'નવા\' મેનૂમાં આઇટમ તરીકે દેખાય છે.','Show In Admin Bar'=>'એડમિન બારમાં બતાવો','Custom Meta Box Callback'=>'કસ્ટમ મેટા બોક્સ કોલબેક','Menu Icon'=>'મેનુ આયકન','The position in the sidebar menu in the admin dashboard.'=>'એડમિન ડેશબોર્ડમાં સાઇડબાર મેનૂમાં સ્થિતિ.','Menu Position'=>'મેનુ સ્થિતિ','By default the post type will get a new top level item in the admin menu. If an existing top level item is supplied here, the post type will be added as a submenu item under it.'=>'ડિફૉલ્ટ રૂપે પોસ્ટના પ્રકારને એડમિન મેનૂમાં નવી ટોચની આઇટમ મળશે. જો હાલની ટોચની આઇટમ અહીં પૂરી પાડવામાં આવે છે, તો પોસ્ટનો પ્રકાર તેની હેઠળ સબમેનુ આઇટમ તરીકે ઉમેરવામાં આવશે.','Admin Menu Parent'=>'એડમિન મેનુ પેરન્ટ','Admin editor navigation in the sidebar menu.'=>'સાઇડબાર મેનૂમાં એડમિન એડિટર નેવિગેશન.','Show In Admin Menu'=>'એડમિન મેનુમાં બતાવો','Items can be edited and managed in the admin dashboard.'=>'એડમિન ડેશબોર્ડમાં વસ્તુઓને સંપાદિત અને સંચાલિત કરી શકાય છે.','Show In UI'=>'UI માં બતાવો','A link to a post.'=>'પોસ્ટની લિંક.','Description for a navigation link block variation.'=>'નેવિગેશન લિંક બ્લોક વિવિધતા માટે વર્ણન.','Item Link Description'=>'આઇટમ લિંક વર્ણન','A link to a %s.'=>'%s ની લિંક.','Post Link'=>'પોસ્ટ લિંક','Title for a navigation link block variation.'=>'નેવિગેશન લિંક બ્લોક વિવિધતા માટે શીર્ષક.','Item Link'=>'આઇટમ લિંક','%s Link'=>'%s લિંક','Post updated.'=>'પોસ્ટ અપડેટ થઇ ગઈ છે.','In the editor notice after an item is updated.'=>'આઇટમ અપડેટ થયા પછી એડિટર નોટિસમાં.','Item Updated'=>'આઈટમ અપડેટેડ.','%s updated.'=>'%s અપડેટ થઇ ગયું!','Post scheduled.'=>'સુનિશ્ચિત પોસ્ટ.','In the editor notice after scheduling an item.'=>'આઇટમ સુનિશ્ચિત કર્યા પછી સંપાદક સૂચનામાં.','Item Scheduled'=>'આઇટમ સુનિશ્ચિત','%s scheduled.'=>'%s શેડ્યૂલ.','Post reverted to draft.'=>'પોસ્ટ ડ્રાફ્ટમાં પાછું ફેરવ્યું.','In the editor notice after reverting an item to draft.'=>'આઇટમને ડ્રાફ્ટમાં પાછી ફેરવ્યા પછી સંપાદક સૂચનામાં.','Item Reverted To Draft'=>'આઇટમ ડ્રાફ્ટમાં પાછી ફેરવાઈ','%s reverted to draft.'=>'%s ડ્રાફ્ટમાં પાછું ફર્યું.','Post published privately.'=>'પોસ્ટ ખાનગી રીતે પ્રકાશિત.','In the editor notice after publishing a